contracts/Barter.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.8;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract Barter is ReentrancyGuard{

    using Counters for Counters.Counter;
    Counters.Counter private _itemIds;
    Counters.Counter private _itemsSold;

    address payable owner;
    uint256 listingPrice=0.001 ether;
    constructor() {
        owner=payable(msg.sender);
    }

    struct BarterItem {
        uint itemId;
        address nftContract;
        uint256 tokenId;

        address payable seller;
        address payable owner;
        uint256 price;
        bool sold;
    }

    
    mapping(uint256 => BarterItem) private idToMarketItem;
    
    event BarterItemCreated(

        uint indexed itemId,
        address indexed nftContract,
        uint256 indexed tokenId,
        address seller,
        address owner,
        uint256 price,
        bool sold
    );
    event MessageSender(
        address indexed s
    );

    function getListingPrice() public view returns (uint256) {
        return listingPrice;

    }

    function createMarketItem(
        address nftContract,
        uint256 tokenId,
        uint256 price
    )
    
    public payable nonReentrant{
       require(price > 0, "Price should at least be 1 wei");
       require(msg.value == listingPrice,"Price must be equal to listing price");

       _itemIds.increment();
       uint256 itemId= _itemIds.current();

  

       idToMarketItem[itemId] =BarterItem(    
           itemId,
           nftContract,
           tokenId,
           payable(msg.sender),

           payable(address(0)),

           price,
           false
       ); 

        IERC721(nftContract).approve(address(this),tokenId);  

        emit BarterItemCreated(
            itemId,
            nftContract,
            tokenId,
            msg.sender,
            address(0),
            price,
            false
        );
        
        }
    
    function createMarketSale(
